import React from "react";

import "./components/Home.css";
import { IntroCard } from "./components/Cards";
import Delivery from "../assets/delivery.png";
import Payment from "../assets/payment.png";
import Discount from "../assets/discount.png";
import Return from "../assets/returnPurchase.png";
import Footer1 from "./components/Footer1";
import Home3 from "./Home3";
import colors from "../config/colors";

function Home2() {
  return (
    <>
      <div className="fluid-container">
        <div
          style={{
            width: "100vw",
            height: "auto",
            background: `url("https://www.womansworld.com/wp-content/uploads/2020/10/womens-clothing-store.jpg") center`,
          }}
        />
        <div className="pt-5">
          <h2
            className="title"
            style={{
              textAlign: "center",
              color: colors.light1,
            }}
          >
            Our Services
          </h2>
          <div className="underline" />
          <div className="cardsContainer pt-5 pb-5">
            <IntroCard
              icon={Delivery}
              title="Free Shipping"
              intro="Free shipping on all US order or order above â‚¹500"
            />
            <IntroCard
              icon={Discount}
              title="Awesome Discount"
              intro="Get Discount upto 40% on women clothings and scandles"
            />
            <IntroCard
              icon={Return}
              title="30 Days Return"
              intro="Simply return it within 30 days for an exchange"
            />
            <IntroCard
              icon={Payment}
              title="Secure Payment"
              intro="100% Secure. We ensure secure payment with RozorPay."
            />
          </div>
        </div>
        {/* </div> */}
        <Home3 />
      </div>
      <Footer1 />
    </>
  );
}

export default Home2;
